import React, { Component } from "react";
import { withRouter } from "react-router-dom";

class SpecificUser extends Component {
  state = {
    nodeName: "Unknown",
    data: {
      keyOne: 10,
      keyTwo: 20,
      keyThree: 15,
      keyFour: 30
    }
  };

  render() {
    return (
      <div>
        <h1>Hello</h1>
        {this.props.location.state.nodeName}
      </div>
    );
  }
}

export default withRouter(SpecificUser);
